"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_3\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px;\">",
"         <span class=\"medCalcFontOneBold\">",
"          BMI &gt;=25 and &lt;30:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Overweight",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_4\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px;\">",
"         <span class=\"medCalcFontOneBold\">",
"          BMI &gt;=30 and &lt;35:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Class I Obesity",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_5\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px;\">",
"         <span class=\"medCalcFontOneBold\">",
"          BMI &gt;=35 and &lt;40:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Class II Obesity",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_6\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px;\">",
"         <span class=\"medCalcFontOneBold\">",
"          BMI &gt;=40:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Class III Obesity",
