var script_f39_41_40593=[" ",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"function alertNaN(thisparam){",
"alert(thisparam + ' is improperly formatted. You may only input the digits 0-9 and a decimal point.');  ",
"doCalc = false; ",
"clrResults();",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function BodyMassIndex_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 2000);",
"",
"with(document.BodyMassIndex_form){",
"",
"",
"doCalc = true;",
"param_value = parseFloat(Height_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Height_unit.options[Height_unit.selectedIndex].value.split('|');",
"Height = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"param_value = parseFloat(Weight_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Weight_unit.options[Weight_unit.selectedIndex].value.split('|');",
"Weight = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"dp = decpts.options[decpts.selectedIndex].text;",
"BMI =  (Weight/2.205) / power((Height/39.37), 2);",
"",
"if (doCalc) BMI_param.value = fixDP(BMI, dp);",
"",
"",
"",
"",
"if (doCalc){",
"rrclr();",
"if (BMI <18.5){ document.getElementById('rr1_1').bgColor = '#cccccc';",
"}",
"if ((BMI >=18.5) && (BMI <25)){ document.getElementById('rr1_2').bgColor = '#cccccc';",
"}",
"if ((BMI >=25) && (BMI <30)){ document.getElementById('rr1_3').bgColor = '#cccccc';",
"}",
"if ((BMI >=30) && (BMI <35)){ document.getElementById('rr1_4').bgColor = '#cccccc';",
"}",
"if ((BMI >=35) && (BMI <40)){ document.getElementById('rr1_5').bgColor = '#cccccc';",
"}",
"if (BMI >=40){ document.getElementById('rr1_6').bgColor = '#cccccc';",
"}",
"",
"}",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.BodyMassIndex_form){",
"",
"if (Height_param.value && isNaN(Height_param.value)){ Height_param.value = ''; alertNaN('Height'); }",
"if (Height_param.value && Height < 0) {",
"Height = 0;",
"Height_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Height is 0 in.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Height_param.value && Height > 108) {",
"Height_param.value = \"\";",
"clrResults();",
"Height = 0;",
"doCalc = false;",
"alert(\"The maximum value for Height is 108 in.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Weight_param.value && isNaN(Weight_param.value)){ Weight_param.value = ''; alertNaN('Weight'); }",
"if (Weight_param.value && Weight < 0) {",
"Weight = 0;",
"Weight_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Weight is 0 lb.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Weight_param.value && Weight > 661) {",
"Weight_param.value = \"\";",
"clrResults();",
"Weight = 0;",
"doCalc = false;",
"alert(\"The maximum value for Weight is 661 lb.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.BodyMassIndex_form){",
"",
"BMI_param.value = '';",
"",
"rrclr();",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"function rrclr(){",
"document.getElementById('rr1_1').bgColor = \"\";",
"document.getElementById('rr1_2').bgColor = \"\";",
"document.getElementById('rr1_3').bgColor = \"\";",
"document.getElementById('rr1_4').bgColor = \"\";",
"document.getElementById('rr1_5').bgColor = \"\";",
"document.getElementById('rr1_6').bgColor = \"\";",
"}",
"",
"",
""].join("\n");
