"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?39/41/40598/abstract/1\">",
"      Salvarani C, Cantini F, Hunder GG. Polymyalgia rheumatica and giant-cell arteritis. Lancet 2008; 372:234.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?39/41/40598/abstract/2\">",
