var title_f39_41_40599="Wagner 1 foot ulcer";
var content_f39_41_40599=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F70998%7EENDO%2F51991%7ESURG%2F63780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F70998%7EENDO%2F51991%7ESURG%2F63780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wagner grade 1 ulcer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 232px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Foot from a diabetic patient showing a superficial ulcer (Wagner grade 1) that involves the full thickness of the skin but no underlying tissues. This lesion healed quickly with rest and local foot care.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of David McCulloch, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wagner grade 2 ulcer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 211px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Foot from a diabetic patient with a penetrating neuropathic ulcer that is not associated with abscess formation or bone involvement (Wagner grade 2). The toes have been pulled anteriorly because the anterior tibial muscles are unopposed due to motor neuropathy-induced weakness of the intrinsic foot muscles. This promotes subluxation of the proximal interphalangeal-metatarsal joints, resulting in a claw toe appearance (arrow) and in increased pressure on the metatarsal heads, predisposing to ulcer formation at this site.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of David McCulloch, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wagner grade 4 ulcer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 241px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Foot from a diabetic patient with a Wagner grade 4 ulcer that extends to the deep layers with signs of local infection, cellulitis, and necrosis. This lesion healed completely after an extensive hospital stay involving excision of necrotic tissue but no amputation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of David McCulloch, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
