"     Reproduced with permission from: Schneider T, Zeitz M. [Illness and immune manifestations in Whipple disease. Differential rheumatic diseases diagnosis] Internist (Berl) 2003; 44:184. Copyright &copy; 2003 Springer-Verlag.",
