" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute generalized exanthematous pustulosis (AGEP)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 354px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Confluent nonfollicular pustules superimposed on&nbsp;edematous erythema in a 46-year-old woman&nbsp;with AGEP. A skin biopsy showed intracorneal pustules with numerous neutrophils and neutrophilc infiltration of the epidermis and upper dermis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Vincent C.B. Lin, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute generalized exanthemous pustulosis (AGEP) detail",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 425px; height: 319px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     Nonfollicular, pinhead-sized&nbsp;pustules on a background of edematous erythema are characteristic of AGEP.",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. Werner Pichler",
"    </div>",
"   </div>",
"  </div>",
" </div>",
