var title_f39_41_40604="Annual testing for hematopoietic cell transplantation survivors";
var content_f39_41_40604=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F59471&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F59471&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Annual testing for hematopoietic cell transplantation survivors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Blood tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Hematology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Complete blood count with differential",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Hepatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Liver function tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum ferritin (if iron overload suspected; not required if previously normal and no longer receiving blood transfusions)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatitis B surface antigen and hepatitis B/C viral load (in patients with known hepatitis B or C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Consider liver biopsy in patients with known chronic hepatitis C after 8 to 10 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Renal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urinalysis and urine microalbumin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Kidney function testing (BUN/creatinine)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Endocrine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fasting lipid profile",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin D level",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Thyroid stimulating hormone and free T4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fasting glucose and hemoglobin A1c",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Testosterone (male)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Follicle stimulating hormone &amp; luteinizing hormone (female)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Immunology/infectious disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CD4 count (to be done 1 year post transplant)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immunoglobulin levels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Radiology and other tests/interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Electrocardiogram (optional)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Echocardiogram or exercise stress testing (optional)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pulmonary function testing and&nbsp;diffusing capacity for carbon monoxide (if previously abnormal)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bone densitometry (at one year)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Opthalmologic evaluation: Schirmer test and intraocular pressure measurement (at one year)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Review of immunization status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dental examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Review smoking status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Second cancer vigilance counseling and age appropriate cancer screening",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blood pressure screening",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f39_41_40604=[""].join("\n");
var outline_f39_41_40604=null;
var title_f39_41_40605="TNM staging penile cancer";
var content_f39_41_40605=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F65885&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F65885&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging system for carcinoma of the penis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Primary tumor (T)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        TX",
"       </td>",
"       <td colspan=\"3\">",
"        Primary tumor cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T0",
"       </td>",
"       <td colspan=\"3\">",
"        No evidence of primary tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tis",
"       </td>",
"       <td colspan=\"3\">",
"        Carcinoma in situ",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ta",
"       </td>",
"       <td colspan=\"3\">",
"        Noninvasive verrucous carcinoma*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1a",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades subepithelial connective tissue without lymph vascular invasion and is not poorly differentiated (ie, NOT grade 3-4)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1b",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades subepithelial connective tissue with lymph vascular invasion or is poorly differentiated (grade 3-4)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades corpus spongiosum or cavernosum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades urethra",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades other adjacent structures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Regional lymph nodes (N)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Clinical stage definition&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        cNX",
"       </td>",
"       <td colspan=\"3\">",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        cN0",
"       </td>",
"       <td colspan=\"3\">",
"        No palpable or visibly enlarged inguinal lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        cN1",
"       </td>",
"       <td colspan=\"3\">",
"        Palpable mobile unilateral inguinal lymph node",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        cN2",
"       </td>",
"       <td colspan=\"3\">",
"        Palpable mobile multiple or bilateral inguinal lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        cN3",
"       </td>",
"       <td colspan=\"3\">",
"        Palpable fixed inguinal nodal mass or pelvic lymphadenopathy unilateral or bilateral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Pathologic stage definition&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pNX",
"       </td>",
"       <td colspan=\"3\">",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN0",
"       </td>",
"       <td colspan=\"3\">",
"        No regional lymph node metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN1",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in a single inguinal lymph node",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN2",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in multiple or bilateral inguinal lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN3",
"       </td>",
"       <td colspan=\"3\">",
"        Extranodal extension of lymph node metastasis or pelvic lymph node(s) unilateral or bilateral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Distant metastasis (M)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td colspan=\"3\">",
"        No distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MI",
"       </td>",
"       <td colspan=\"3\">",
"        Distant metastasis&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Additional descriptor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        The m suffix indicates the presence of multiple primary tumors and is recorded in parentheses - eg, pTa (m) N0M0.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Anatomic stage/prognostic groups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Stage 0",
"       </td>",
"       <td>",
"        Tis",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ta",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage I",
"       </td>",
"       <td>",
"        T1a",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Stage II",
"       </td>",
"       <td>",
"        T1b",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIIa",
"       </td>",
"       <td>",
"        T1-3",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIIb",
"       </td>",
"       <td>",
"        T1-3",
"       </td>",
"       <td>",
"        N2",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Stage IV",
"       </td>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        Any N",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        N3",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        Any N",
"       </td>",
"       <td>",
"        M1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Broad pushing penetration (invasion) is permitted; destructive invasion is against this diagnosis.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Clinical stage definition based on palpation, imaging.",
"      <br>",
"       &Delta; Pathologic stage definition based on biopsy or surgical excision.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        Lymph node metastasis outside of the true pelvis in addition to visceral or bone sites.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Used with the permission of the American Joint Committee on Cancer (AJCC), Chicago, Illinois. The original source for this material is the AJCC Cancer Staging Manual, Seventh Edition (2010) published by Springer New York, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
